using Common.DataModels.Enums;
using System.Collections.Generic;

namespace Common.DataModels
{
    public static class Constants
    {
        public static IReadOnlyList<string> DefaultColorPalette { get; } = new List<string>()
        {
            Colors.Black,
            Colors.LightBlue,
            Colors.LightGreen,
            Colors.Peach,
            Colors.Purple,
            Colors.Yellow,
            Colors.Brown,
        };

        public static class Colors
        {
            public const string DarkGray = "rgb(66,66,66)";
            public const string Brown = "rgb(117,86,41)";
            public const string Black = "rgb(0,0,0)";
            public const string LightBlue = "rgb(78,193,219)";
            public const string LightGreen = "rgb(123,219,78)";
            public const string Peach = "rgb(255,101,101)";
            public const string Purple = "rgb(91,80,220)";
            public const string Yellow = "rgb(230,230,0)";
        }

        public static class RegexStrings
        {
            public const string UserId = "^([0-9A-Za-z]){50}$";
            public const string Guid = "^([0-9A-Fa-f]{8}[-][0-9A-Fa-f]{4}[-][0-9A-Fa-f]{4}[-][0-9A-Fa-f]{4}[-][0-9A-Fa-f]{12})$";
            public const string ImageDataUrl = "^data:image/png;base64,[a-zA-Z0-9+/]+=*$";
            public const string ColorString = "^rgb\\([0-9]{1,3},[0-9]{1,3},[0-9]{1,3}\\)$";
        }
        private static bool drawingIsBodyPart(DrawingType drawingType) 
          { return (drawingType == DrawingType.Head || drawingType == DrawingType.Body || drawingType == DrawingType.Legs); }

        public static class Drawings
        {
            public const string NoneUnityImage = "data:image/png;base64,";
            private const string Empty360by360 = "data:image/png;base64,";
            public const string DefaultBodyPartDrawing = "data:image/png;base64,";
            public static string DefaultDrawing(DrawingType drawingType)
            {
                if (drawingType == DrawingType.Generic)
                {
                    return Empty360by360;
                }
                else if (drawingIsBodyPart(drawingType))
                {
                    return DefaultBodyPartDrawing;
                }
                else
                {
                    return Empty360by360;
                }
            }
        }
    }
}
